const { user, getUser } = useContext(UserContext)


useEffect(() => {
    async function getSingleUser(){
       await getUser()
    }
    getSingleUser()
}, [])

   return(
       <div>
           <h1>Ordini</h1>
       </div>
   )
}

export default Ordini
